Yatim Mandiri Bogor membuat Video ini sebagai bentuk kepedulian kepada sesama. Dan sebagai ajang kompetisi lomba video pendek dengan tema "Berbagi kebaikan di tengah pandemi" untuk memeriahkan dan berlomba-lomba dalam berbuat kebaikan fastabkhul khairat di hari Kemerdekaan Republik Indonesia yang ke 75.

Semoga video pendek ini dapat menjadi inspirasi bagi yang lainnya.

Jum'at, 28 Agustus 2020 yatim mandiri Bogor membagikan 60 paket sembako warga dhuafa terdampak pandemi Covid 19 yang berlokasi di kampung ciherang kidul  desa laladon kecamatan ciomas kabupaten bogor.
kegiatan ini bekerjasama dengan komunitas club mobil  AXS sebagai tranportasi membawa bantuan ke lokasi.
Semoga dengan adanya bantuan ini bisa membantu Mereka yang membutuhkan.semoga rezekinya para donatur semakin berkah dan bertambah.Aamiin

